SELECT COUNT(*) as agg_0 FROM "info_type" LEFT OUTER JOIN "movie_info_idx" ON "info_type"."id" = "movie_info_idx"."info_type_id" LEFT OUTER JOIN "title" ON "movie_info_idx"."movie_id" = "title"."id" LEFT OUTER JOIN "movie_keyword" ON "title"."id" = "movie_keyword"."movie_id" LEFT OUTER JOIN "keyword" ON "movie_keyword"."keyword_id" = "keyword"."id" LEFT OUTER JOIN "movie_info" ON "title"."id" = "movie_info"."movie_id"  WHERE "keyword"."id" >= 93905 AND ("movie_info_idx"."info" NOT LIKE '%7.5%' OR "movie_info_idx"."info_type_id" != 107 OR "movie_info_idx"."info" NOT LIKE '%7%.9%') AND "movie_info"."id" >= 7809518 AND "movie_info"."info_type_id" BETWEEN 2 AND 17;